    ctx.markdownInited = true;
    return '<div class="sidebar-layout" style="width: 100%; height: 100%; padding: 0; overflow-y: auto;">' +
            '<tb-dashboard-state fxFlex [ctx]="ctx" [syncParentStateParams]="true" stateId="cost"></tb-dashboard-state>' +
        '</div>';
}

